import React from "react";
import logo from "../../assets/logo.png";
import ReactLogo from "../../assets/logo.svg";

const Logo = () => {
  return (
    <div className="Logo">
      <img src={logo} alt="Logo" />
    </div>
  );
};

export default Logo;
